import React from 'react';

const HomeSection = () => {
  const containerStyle = {
    width: '100%',
    height: '100%',
    backgroundColor: '#f0f0f0',
    textAlign: 'center',
    paddingTop: '20px',
    position: 'relative',
  };

  const imageStyle = {
    maxWidth: '100%',
    maxHeight: '100%',
    height: 'auto',
    width: 'auto',
    position: 'absolute',
    top: '0',
    left: '0',
    zIndex: '1', // Ensure the image is behind the rectangle box
  };

  const rectangleBoxStyle = {
    width: '100px',
    height: '100px',
    backgroundColor: 'lightyellow',
    position: 'absolute',
    bottom: '0',
    right: '0',
    zIndex: '2', // Ensure the rectangle box is on top
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  return (
    <div style={containerStyle}>
      <img
        src="/scandinavian-interior-mockup-wall-decal-background 1.png" // Replace with the actual URL of your image
        alt="Description of the image"
        style={imageStyle}
      />
      <div style={rectangleBoxStyle}>
        {/* Content of the rectangle box */}
        <p>New Content</p>
      </div>
    </div>
  );
};

export default HomeSection;
